        {id: 3, name: 'Carl', country: 'Canada'},
      ];

      const results = [];
      employees.forEach((employee, index) => {
        results.push(
          <div key={index}>
            <h2>name: {employee.name}</h2>
            <h2>country: {employee.country}</h2>

            <hr />
          </div>,
        );
      });
  return (
    <div>

    <div>
    {employees.map((gf,id)=>(
<div>
<h1>{id}</h1>
    <h1>Name:{gf.name}</h1>
    <h1>Name:{gf.country}</h1>
    </div>
    ))}


    </div>

    </div>
  )
}

export default Purecomp
